import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

import React from "react";
import Button from "@material-ui/core/Button";
import { makeStyles } from "@material-ui/core/styles"; // styles 기능 추가

const useStyles = makeStyles(theme => ({  // style 요소 선언
  margin: {
    margin: theme.spacing(1),
  }
}));

function ButtonComponent() {
  const classes = useStyles();   // 생성
  return (
    <div >
      <Button variant="contained" color="primary" className={classes.margin}> // 사용
        Primary
      </Button>
      <Button variant="contained" color="secondary" className={classes.margin}>
        Disabled
      </Button>

    </div>

  );
}

function App() {

  let [글제목, 글제목변경] = useState(['배우고 싶은 언어', '나의 소개'])

  return (
    <div className="App">

      <div className="pink">
        <h4>yealin</h4>
      </div>
      <div className="list">
        <h4>{글제목[0]}</h4>
      </div>
      <div className="list">
        <h4>{글제목[1]}</h4>
      </div>


    </div>
  );
}

export default App;
